import React from "react";
import './styles.css';
import './slider.js';

const  Slider = () => (
    <slider className="sayfa">
        <div className="sliderKonum">
            <div className="slider">
                <a className="img-bir" href="#">
                    <img src="assets/images/iphone14.jpg" alt="iphone14" />
                </a>
                <a  className="img-iki" href="#">
                    <img src="assets/images/php.png" alt="php" />
                </a>
                <a className="img-uc" href="#">
                    <img src="assets/images/unreal-engine5.jpg" alt="unrelengine5" />
                </a>
            </div>
        </div>

    </slider>
);

export default Slider;
